// App.js
import React, { useState } from 'react';
import Collapsible from './Collapsible';

function App() {
  const [output1, setOutput1] = useState('');
  const [output2, setOutput2] = useState('');
  const [file2, setFile2] = useState(null);

  const handleFileUpload = async (event) => {
    const file = event.target.files[0];
    const formData = new FormData();
    formData.append('file', file);

    const response = await fetch('http://localhost:5000/upload', {
      method: 'POST',
      body: formData,
    });

    const data = await response.json();
    setOutput1(data.output1);
    setOutput2(data.output2);
  };

  const handleFile2Upload = async () => {
    if (!file2) return;

    const formData = new FormData();
    formData.append('file', file2);

    const response = await fetch('http://localhost:5000/upload', {
      method: 'POST',
      body: formData,
    });

    const data = await response.json();
    setOutput1(data.output1);
    setOutput2(data.output2);
  };

  const handleFile2Change = (event) => {
    setFile2(event.target.files[0]);
  };

  return (
    <div className="App">
      <input type="file" onChange={handleFileUpload} />
      {output1 && <Collapsible title="Output 1" content={output1} />}
      {output2 && <Collapsible title="Output 2" content={output2} />}
      <input type="file" onChange={handleFile2Change} />
      <button onClick={handleFile2Upload}>Upload Second File</button>
    </div>
  );
}

export default App;
